import React, { Component } from "react";

class CarDetails extends Component {
  render() {
    const carId = this.props.match.params.carId; // Extract carId from URL params
    // You can fetch car details using carId from your backend here
    return (
      <div>
        <h1>Car Details Page</h1>
        <p>Car ID: {carId}</p>
        {/* Display car details here */}
      </div>
    );
  }
}

export default CarDetails;
